snippet.description:
Słuchaj w cyfrze - https://mugo.lnk.to/BonusRPK_znieczulica

Ciemna Strefa prezentuje najnowszy singiel Bonusa RPK pt. "Znieczulica", do którego gościnnie dograli się Czerwin i Kali. Za warstwę muzyczną odpowiadają Czaha i Wowo, a teledysk zrealizowała ekipa 9Liter Filmy. 


